import React, { useState } from "react";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import Signup from "./Pages/Signup";
import Home from "./Pages/Home";
import Login from "./Pages/Login";
import ViewPost from "./Pages/ViewPost";
import Post, { PostContext } from "./Store/PostContext";
import AddCart from "./Store/AddtoCartContext";
import AddTCartPage from "./Pages/AddTCartPage";
import { useContext } from "react";

function App() {
  return (
    <div>
      <Post>
        <AddCart>
          <Routes>
            <Route path="/" element={<Home />}></Route>
            <Route path="/signup" element={<Signup />}></Route>
            <Route path="/login" element={<Login />}></Route>
            <Route path={"/view/:productId"} element={<ViewPost />}></Route>
            <Route path="/cart" element={<AddTCartPage></AddTCartPage>}></Route>
          </Routes>
        </AddCart>
      </Post>
    </div>
  );
}

export default App;
